  false,\n\t\"url\": null,\n\t\"notes\": \"Sediment samples collected in 1987 from
  the Quantum Chemical Corporation outfall on the Upper Mississippi River detected
  14 polycyclic aromatic hydrocarbons (PAH's). The highest concentration was phenanthrene
  at 110 ppm. Bioassays conducted on fathead minnows using sediments in the immediate
  vicinity of the outfall resulted in 100% mortality. Dr. Paul Bauman concluded that
  the Quantum sediment PAH's were at a carcinogenic level. However, David Trauger,
  Director of the Patuxent Wildlife Research Center responded that the hazard potential
  was unknown. Quantum estimated less than 10 cubic yards of contaminated sediment
  is present at the outfall. This sediment was not included in the Superfund action.
  However, negotiations with EPA and Quantum continue in an effort to have the contaminated
  sediment removed. The NPDES permit has been tightened. Quantum Chemical is required
  to monitor for 63 priority pollutants associated with organic chemical manufacturing.
  They are also required to perform effluent toxicity testing with zero mortality
  permitted. Such testing to date has resulted in no mortality. Our concerns expressed
  to Iowa Department of Natural Resources regarding continuing potential impacts from
  the Quantum outfall to federally listed endangered species, Lampsilis higginsi and
  Haliaetus leucocephalus, were deferred to the U.S. Environmental Protection Agency.\",\n\t\"owner_org\":
